import React from 'react';
import '../App.css';

const Keypad = (props) => {

    const handleChange = (e) => {
        console.log(e.target.value);
    }


    return( 
            <button type="button" id={props.id} value={props.value} onClick={handleChange}>{props.value}</button>
    )
}
export default Keypad;
